import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import { useState } from 'react';
import { AnimatePresence, motion } from 'framer-motion';
import Header from './components/Header';
import LandingPage from './pages/LandingPage';
import Login from './pages/Login';
import Register from './pages/Register';

function App() {
  const [user, setUser] = useState(null); // { id, name, email, role, token }

  return (
    <Router>
      <div className="min-h-screen flex flex-col bg-gradient-to-br from-white via-gray-50 to-blue-50">

        {/* Sticky Header */}
        <Header user={user} setUser={setUser} />

        {/* Animated Page Wrapper */}
        <main className="flex-grow pt-20 px-4 md:px-8 lg:px-20">
          <AnimatePresence mode="wait">
            <Routes>
              <Route
                path="/"
                element={
                  <motion.div
                    key="home"
                    initial={{ opacity: 0, y: 30 }}
                    animate={{ opacity: 1, y: 0 }}
                    exit={{ opacity: 0, y: -30 }}
                    transition={{ duration: 0.4 }}
                  >
                    <LandingPage user={user} />
                  </motion.div>
                }
              />
              <Route
                path="/login"
                element={
                  <motion.div
                    key="login"
                    initial={{ opacity: 0, y: 30 }}
                    animate={{ opacity: 1, y: 0 }}
                    exit={{ opacity: 0, y: -30 }}
                    transition={{ duration: 0.4 }}
                  >
                    <Login setUser={setUser} />
                  </motion.div>
                }
              />
              <Route
                path="/register"
                element={
                  <motion.div
                    key="register"
                    initial={{ opacity: 0, y: 30 }}
                    animate={{ opacity: 1, y: 0 }}
                    exit={{ opacity: 0, y: -30 }}
                    transition={{ duration: 0.4 }}
                  >
                    <Register setUser={setUser} />
                  </motion.div>
                }
              />
            </Routes>
          </AnimatePresence>
        </main>

        {/* Footer */}
        <footer className="bg-[#064E86] text-white mt-16">
  <div className="max-w-7xl mx-auto px-6 lg:px-20 py-12 grid grid-cols-1 md:grid-cols-4 gap-10">

    {/* Logo & About */}
    <div>
      <h2 className="text-2xl font-bold">TalentHub</h2>
      <p className="text-gray-300 mt-3 text-sm leading-relaxed">
        TalentHub connects skilled professionals with the right opportunities. 
        Our mission is to make hiring simple, transparent, and efficient.
      </p>
    </div>

    {/* Quick Links */}
    <div>
      <h3 className="text-lg font-semibold mb-3">Quick Links</h3>
      <ul className="space-y-2 text-sm text-gray-300">
        <li><a href="/" className="hover:text-white">Home</a></li>
        <li><a href="/login" className="hover:text-white">Login</a></li>
        <li><a href="/register" className="hover:text-white">Register</a></li>
        <li><a href="/jobs" className="hover:text-white">Browse Jobs</a></li>
      </ul>
    </div>

    {/* Resources */}
    <div>
      <h3 className="text-lg font-semibold mb-3">Resources</h3>
      <ul className="space-y-2 text-sm text-gray-300">
        <li><a href="/about" className="hover:text-white">About Us</a></li>
        <li><a href="/faq" className="hover:text-white">FAQ</a></li>
        <li><a href="/support" className="hover:text-white">Support</a></li>
        <li><a href="/terms" className="hover:text-white">Terms & Privacy</a></li>
      </ul>
    </div>

    {/* Contact */}
    <div>
      <h3 className="text-lg font-semibold mb-3">Contact</h3>
      <p className="text-gray-300 text-sm">📍 Addis Ababa, Ethiopia</p>
      <p className="text-gray-300 text-sm">✉️ support@talenthub.com</p>
      <p className="text-gray-300 text-sm">📞 +251 911 234 567</p>
      <div className="flex space-x-4 mt-4">
        <a href="#" className="hover:text-white">🌐</a>
        <a href="#" className="hover:text-white">🐦</a>
        <a href="#" className="hover:text-white">📘</a>
        <a href="#" className="hover:text-white">📸</a>
      </div>
    </div>
  </div>

  {/* Bottom Bar */}
  <div className="border-t border-gray-700 mt-10 py-4 text-center text-sm text-gray-400">
    © {new Date().getFullYear()} TalentHub. All rights reserved.
  </div>
</footer>

      </div>
    </Router>
  );
}

export default App;
